import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.value;
  const links = linkTitle.map((number) =>
    <li className='nav-link' key={number[0]} href={number[1]}>
        {number[2]}
        {console.log(number[2])}
    </li>
  );

  return (
    <div className="navbar">
        <ul className="nav">
          {links}
        </ul>
      </div>
  );
}

export default Nav;
